INSERT INTO `blog_article` VALUES ('69fee9e1851b4c648ed9cf0d6f26408e', '金三银四，如何征服面试官，拿到Offer', '<p>又到了茶余饭后的时间，想想写点什么，掐指一算，噢呦，快到3月份了，职场的金三银四跳槽季又来了，不同的是今年比往年「冷」一些，形式更加严峻一些，大家多多少少可能都听到或看到一些信息，就是好多公司在优化裁员，代表的就是滴滴、京东这种大型互联网公司，已经官宣了。</p><p>即使这种情况下，我相信，3、4月份仍然会有一波离职、求职潮。</p><p>作为求职这来说，面试是一道坎，很多人会恐惧面试，即使是工作很多年的老鸟，可能仍存在面试的焦虑。</p><p>今天就来说一说如何面好一场试。</p><p><span>不管环境怎么变，在技术领域，实力仍是职场人员的立身之本。</span></p><p><span>先说一下为什么有的人会害怕面试 ？&nbsp;应该无非两点 ：第一，自身实力的不自信 。第二，不会表达。</span></p><p>&nbsp;</p><p><span><b>下面就来说一说破解之道</b></span></p><p><span><b>0、准备</b></span></p><p>收到面试邀请，一定提前查企业相关信息，信息可以从网上搜索，多找一些信息看，面试前对企业有个基本的判断，是否符合自己的预期，如果感觉还不错，接下来就需要详细看一看企业的岗位要求，对标自己，提前做些准备，梳理梳理脑袋里的东西。</p><p>面试当天建议提前20分钟左右到面试企业的楼下，在楼下在做一些心理上的准备，克服克服紧张的情绪，离面试时间10分钟左右，进入企业，准备面试。</p><p>&nbsp;</p><p><span><b>1、自信</b></span></p><p>真正自信的人，从精神面貌上映射给人的感觉完全是不一样的。一个自信的面试者和不自信的面试者给面试官的感觉是明显不一样的。我们应该在平时注重提升自信力，从一点一滴去积累。这玩意不可能一蹴而就。</p><p>自信是自己给自己的，是自己认可自己的一种表现。需要一个一个小目标去完成，需要一个一个小磨难、小挫折去历练。</p><p>那平时就不太自信，现在要去面试，怎么破 ?&nbsp;假如你是这种情况，那就多想想自己熟悉的东西，干过的值得骄傲的事情，内心给自己一些肯定。</p><p>举例来说 :&nbsp;面试企业岗位要求10个技术，自己满足了5个，另外5个不满足，这时候求职者就容易不自信，害怕面试官问到那5个不熟悉的技术。</p><p>这种时候不要老想着那5个不熟悉的玩意，多想想自己熟悉的5个技术，想想自己用这5个技术干过的牛逼事，给自己一个信心，哈，我还会这么多呢，给自己打打气。</p><p>企业选择一个求职者，可能就是看中求职者身上的某一个点，并不是所有条件都满足才会被录取。</p><p>面对面试官时，一定拿出最饱满、最自信的那个自己，大方得体，先不说技术实力如何，从精神气质上先给面试官一种积极向上的感觉。南风哥面试过不少人，有那么一部分人话都说不出来，眼睛都不敢正视面试官，这还没开始面，从感觉上已经PASS了求职者。</p><p>&nbsp;&nbsp;</p><p><span><b>2、表达</b></span></p><p>有了自信的支撑，下来就需要一个良好的表达了，面试的一般套路是&nbsp;<span>自我介绍 -&gt;&nbsp;项目情况 -&gt;&nbsp;实现细节 -&gt;&nbsp;技术原理 -&gt;&nbsp;其他综合</span>，表达做好两点，第一：流畅，第二：逻辑清晰&nbsp;基本就成了，然后就是肚子里的货尽量的亮出来，该表达的表达出来。</p><p>如何做到流畅 ？\"无他 唯手熟尔\",&nbsp; 就是多练 ，之前文章也提到过，表达可能是大多数程序员的通病，所以有机会一定多去表达。</p><p>现在马上就面试，没有太多时间练怎么办 ？办法就是自我介绍部分，写稿子，尽量简短，背下来。其他部分还是建议临场发挥，因为不知道面试官的考察角度和问题点，省得做无用功，但是对应技术的常见面试问题，项目经验等应该自己在脑子里提前预演的过几遍。只要自我介绍完，那几分钟紧张完，进入状态后，其实后面就相对好很多。</p><p>所以，请开好一个头，就是自我介绍。</p><p>&nbsp;</p><p>如何做到有逻辑 ？\"无他 唯手熟尔\",&nbsp; 还是多练 ，表达有层次、有逻辑一定程度上能反映出求职者的表达能力和技能的熟悉程度，做好了是加分项。</p><p>表达时可以这样去说，首先... ，其次... ，然后... ,&nbsp;最后...&nbsp; 或者&nbsp;第一... ，第二... ,&nbsp;第三... ，第四... 。 有层次有逻辑的说给面试官，想办法将自己的一大段长表达转换成前面的任意一种形式。</p><p>举个例子 ：面试官问，你们的项目研发过程是怎么样的 ？</p><p>&nbsp;- 长篇大论形式：我们的项目先是需求调研，调研完了后交给产品部进行设计，产品输出需求文档和设计好的原型给到研发，研发安排人手，任务开始研发，巴拉巴拉........。</p><p>&nbsp;-&nbsp;分段形式：首先，我们会进行需求调研，其次，调研完了后需要产品部进行需求整理和原型设计，然后，把原型和设计交给研发，最后，研发安排人手开始研发，巴拉巴拉....。</p><p>显而易见，分段表述会让听者更容易接受，也更能感受到事情推进的逻辑层次，先后顺序。</p><p>&nbsp;</p><p><span><b>3、有货</b></span></p><p>这就是真正的实力的体现了，自己多少墨水，有经验的面试官几个问题就可以探的清清楚楚，所以简历上轻易不要作假，免得搬起石头砸自己脚。</p><p>这里做好三点：第一，会的东西一定整清楚，基本的东西不能出错，第二，不熟悉或不会的东西，临时抱佛脚去看一看，能补多少补多少，第三，体现你的专业素养。</p><p>碰到会的问题，一定多说一点，但要控制一个度，言多必失，见好就收。</p><p>不会的问题，一是，有多少倒多少，二是，可以尝试往自己熟悉的知识点上引。</p><p>专业所养怎么说 ？举个例子，南风哥之前问过一个面试者，Tomcat配置熟悉吗 ？&nbsp;面试者答 : Tomcat ?&nbsp;就是一个猫图标的那个软件吗？&nbsp;这么一个回答，感觉像非IT从业人员的回答，让南风哥感觉面试者不是这个行业的人。又如何相信你能胜任一份IT行业的工作。</p><p><span>所以，请校准你的技术名词，修正你的专业术语表达，展现你的技能水平，最后，体现你的专业素养。</span></p><p><span>还是上面的那句话，不管环境怎么变，在技术领域，实力仍是职场人员的立身之本。&nbsp;感觉有差距，还是平时的努力不够啊。</span></p><p>&nbsp;</p><p>&nbsp;</p><p><span><b>企业的考虑</b></span></p><p>这里为什么加上企业的考虑这个内容，可能有很多求职者有这样的疑惑，我感觉面试表现还不错，聊的都挺嗨得。为什么没offer ？这时候就是 「企业的考虑」&nbsp;范畴的内容了，对求职者来说，知己知彼方能战无不胜，来一起瞧一瞧。</p><p><span><b>0、不达标</b></span></p><p>没啥说的，没满足企业的需求，只是自己的自我感觉良好而已。</p><p>&nbsp;</p><p><span><b>1、岗位匹配程度</b></span></p><p>你的各方面表现确实不错，但是目前跟企业所需的岗位匹配程度不是很高，这种情况是会被PASS掉的。</p><p>&nbsp;</p><p><span><b>2、性价比</b></span></p><p>同样的岗位，可能有很多求职者竞争，水平差不多的情况下，企业当然会优先考虑成本相对较低的求职者，毕竟，企业不是慈善机构，挣钱才是企业的目的，省钱么，能省一点是一点。</p><p>&nbsp;</p><p><span><b>3、潜质</b></span></p><p>目前你各方面都比较符合企业的岗位需求，但是此岗位的人选是企业远期计划中关键的一个点，所以需要有一定潜质的人，能够跟上来的人，这时候如果面试时候没有表现出太多的潜质方面的东西，也是会被PASS掉的。</p><p>&nbsp;</p><p><span><b>4、经验</b></span></p><p>你的能力各方面都不错，但是企业目前急需这个岗位的人进来解决企业目前面临的一个问题，说简单点，就是用你的经验，而你不具备这方面的现成经验，让你学会后再解决，时间不允许啊，所以，也会被PASS。</p><p>&nbsp;</p><p><span><b>5、稳定性</b></span></p><p>这里有两种情况，一种是面试时，比如你频频谈到创业的问题，就会给面试官一种不稳定的感觉，好像随时都会离职去创业。另一种是，你太牛逼，薪资岗位都无法满足你，企业容不下你这尊大神。即使满足，企业的瓶颈也决定你在这呆不长，这也会被PASS。</p><p>&nbsp;</p><p><span><b>总结</b></span></p><p>总之，面试是个技术活，还夹杂些许运气成分，平日里注重自我学习和技能的提升，自身实力硬才是硬道理。本文从「面试者自身」和「企业」两个角度分别说了面试中的一些点，也给了面试者一些应对措施，希望能给求职者带来一些帮助。</p><p>最后，祝愿即将跳槽和已经开始求职的大家都能找到一份好的工作。</p><p>Over。</p>  \r\n					', '学习', 0, '开源中国', '1', NULL, 'img/temp/upload/article/pics/6a04e6de-d970-4162-a4bb-fb415d95cad4.jpeg', NULL, 'admin', '2019-03-28 14:07:35', 'admin', '2019-03-28 14:48:29', '金三银四', '0', '0');
INSERT INTO `blog_article` VALUES ('b19a7a0dc50446e3a357fbeefe3374e8', '边缘计算时代来了，你准备好了吗？', '<p>边缘计算已成为物联网（IoT）的重要趋势，高德纳咨询公司将边缘计算确定为2019年的最佳技术趋势之一。提供物联网解决方案的公司看到了在更接近产生数据的地方处理数据带来的价值。最近Forrester调查发现，在未来的3年时间里，53％的受访者希望在边缘分析复杂数据集，这也证实了这一趋势。因此一些人甚至做出了“边缘计算将吃掉云计算”的猜测。</p><p>边缘计算正在引起多方关注，因为它确实可以解决工业物联网案例的一些关键问题。比如说边缘计算允许在更靠近传感器的地方分析和过滤数据，只有少数数据被发送到云端，这一举措可以大幅降低网络带宽成本和云数据存储成本。</p><p>另外，许多工业物联网使用案例中需要亚秒级（即1GHz/1.2秒）响应时间才能实现安全且精确的操作。例如，如果人类太靠近工业设备，则设备需要立即停止工作。在这种情况下，设备停止工作的决定不能等待物联网云平台的信号反馈。如果将信号处理放到边缘，那么整个反映过程可能会实现亚秒级响应时间。另一种用例是自动驾驶汽车，它也需要亚秒级响应时间。</p><p>工业物联网案例中的安全和隐私要求也推动了对边缘计算的需求。工厂和关键基础设施正在使用边缘设备来保护关键工业流程和设备免受其他网络连接的影响。同样，这些机器生成的数据通常也会被视为机密，通过边缘计将敏感信息保存在工厂内部。最后，边缘计算还允许自主操作。如果存在网络连接问题，许多工业操作就出现失控的情况。一旦应用边缘计算，无论网络可用性如何，都可以保障设备和工厂继续运行。</p><p><span><b>“抢滩登陆”边缘计算</b></span></p><p>边缘计算引起了技术供应商的关注，一些小型初创公司正在创建专门的边缘计算堆栈。物联网平台供应商拥有连接到物联网硬件的边缘解决方案，甚至开源基金会也看到了边缘计算的潜在巨大机会。</p><p>不同供应商和开源社区之间的较量仍在动态发展中。一些供应商正在寻求完整的云解决方案，有些供应商已经相互建立起了合作伙伴关系，另一些则与开源社区合作。该领域暂时没有明确的领跑者，但似乎有些人已经取得了比其他人更多的成功。</p><p><span><b>物联网云提供商</b></span></p><p>物联网云提供商边缘计算解决方案致力于为客户提供集成的整体解决方案，包括从边缘平台到云平台整体的设备。它们使客户更容易构建，部署和管理与其云平台连接的物联网设备。对于希望快速推出新连接产品的客户来说，这是一个引人注目的举措。但是，这种集成解决方案的风险在于它会被长期供应商绑定。</p><p>亚马逊和微软是物联网云提供商的重量级玩家，两者都有与其各自的物联网云平台连接的边缘计算解决方案。Amazon Web Services提供AWS IoT Greengrass，允许连接的设备运行AWS Lambda功能，AWS服务可以运行机器学习，数据同步以及与AWS IoT Core的连接。同样，Microsoft IoT Edge允许连接的设备运行MS Azure服务，微软已经使IoT Edge成为GitHub上的一个开源项目。这似乎可以更容易地将IoT边缘设备移植到其他硬件平台，但它似乎又与Azure IoT Hub云平台紧密相关。</p><p>谷歌已经发布了Cloud IoT Edge，它似乎专注于提供边缘的AI功能，但Cloud IoT Edge仍处于alpha状态。谷歌还宣布与著名的边缘计算供应商Foghorn建立合作伙伴关系。</p><p><span><b>物联网平台</b></span></p><p>许多物联网平台供应商也在创建自己边缘计算产品。Litmus Automation，Clearblade，Bosch IoT Suite，Software AG Cumulocity等公司提供与其物联网平台相连的边缘计算解决方案。这些公司的重点是能够实现在边缘硬件上运行数据分析和机器学习模型。</p><p>其中一些供应商还与物联网硬件供应商建立了合作伙伴关系。例如，Software AG与戴尔和Eurotech合作，在戴尔和Eurotech硬件上提供其边缘软件解决方案。针对该优势的集成硬件和软件解决方案将使这些公司更容易向客户推广联合解决方案。</p><p><span><b>边缘计算供应商</b></span></p><p>有许多风险投资支持的初创公司专注于提供边缘计算解决方案。Foghorn和Swim等公司专注于提供机器学习和分析，Zededa和Edgeworx等其他公司正在将边缘设备引入虚拟化技术和容器技术。所有这些公司都在与主要的物联网平台和物联网云提供商建立合作伙伴关系，将他们的边缘计算解决方案连接到不同的物联网平台。</p><p><span><b>物联网硬件供应商</b></span></p><p>物联网网关供应商正在投资在其硬件上运行的软件堆栈。这些软件堆栈正变得越来越复杂，以满足边缘计算用例的需求。有趣的是，许多硬件供应商正在构建基于开源项目的软件解决方案。</p><p>戴尔和Rigado拥有运行Ubuntu Core的物联网网关，允许远程管理和部署在其网关设备上运行的软件，戴尔还是边缘计算EdgeX开源项目的领导者。Eurotech提供基于Eclipse Kura的Everywhere Software Framework，用于构建边缘计算应用程序。台湾大型网关制造商ADLINK开发了Vortex Edge和Vortex DDS，以便更轻松地在其网关上部署软件，其中Vortex DDS是基于Eclipse Cyclone DDS的项目。</p><p><span><b>开源社区</b></span></p><p>开源基金会也正在积极参与边缘计算这场革命。由于开源基金会的中立性，所以它可以为公司和个人提供更好的交流平台，促进多发协作，一起研究创新边缘计算技术。对于担心被供应商控制的公司，特别是AWS和Microsoft这种纯商业行为，新兴的边缘计算开源社区提供了一个有趣的替代方案。</p><p>在大多数情况下，物联网云提供商，物联网平台供应商和Edge初创公司都没有参与构建边缘技术的协作开源社区。仅仅有很少数一部分人创建了自己的开源项目，大多数人还是继续专注于提供特定于供应商的商业解决方案。商业解决方案通常是基于开源技术构建的，但公司并未积极参与。然而，这些供应商的这些行为并没有削弱开源基金会启动边缘计算协作开源项目的势头。</p><p>Linux基金会最近宣布组建LF Edge社区。LF Edge包括5个不同的开源项目，包括EdgeX和Zededa的虚拟化项目Project EVE。社区已经有60家成员公司，其中包括Arm、AT＆T、戴尔、爱立信、IBM、英特尔、三星等，他们同意就构建边缘计算的通用框架进行合作。</p><p>Eclipse Foundation是物联网领域最成熟的开源社区之一。Eclipse IoT创建于6年前，拥有30多个开源项目，其中也包括许多用于边缘计算的项目。Eclipse Kura是Eclipse的边缘计算项目，其中也包含了Eclipse ioFog和Eclipse fogO5，它们创造了新的边缘计算技术。Eclipse还承载了边缘计算所需的流行行业标准的实现，例如MQTT，OPC-UA，DDS，CoAP和LWM2M。</p><p>OpenStack Foundation也逐渐扩展到了边缘计算领域。2018年10月，StarlingX项目是基于Wind River的代码贡献启动，它由不同开源项目集成而成的项目，其中集成了包括CentOS，OvS-DPDK，Ceph，Kubernetes和OpenStack等，目的是在边缘设备上运行云服务。</p><p><span><b>总结</b></span></p><p>边缘计算将成为任何物联网解决方案中必不可少的组成部分。客户受益于边缘计算解决方案的创新和多样性。在单一供应商提供完整优势与云基础架构的易用性与将解决方案集成在一起的成本以及长期避免供应商锁定之间存在权衡。随着时间的推移，客户通常需要针对分布式技术（如边缘计算）的异构计算解决方案。如果历史重演，那么这一次业界将通过定义边缘计算与云通信的通用标准和协议来解决这个问题。与Web技术一样，这些标准和协议可能由不依赖于任何供应商的开源和标准社区实施。</p><p><span id=\"OSC_h3_1\"></span><span></span><span id=\"OSC_h3_2\"></span><span></span><span id=\"OSC_h3_3\"></span><span></span><span id=\"OSC_h3_4\"></span><span></span></p>  \r\n					', '学习', 0, '开源中国', '1', NULL, 'img/temp/upload/article/pics/50828069-655d-4bf4-8f76-25c2951457b4.jpeg', NULL, 'admin', '2019-03-28 14:50:05', 'admin', '2019-03-28 14:54:24', '', '0', '0');
